import { StyleSheet } from 'react-native'

const StyleCentre = StyleSheet.create({
    
    conteiner:{
        display:'flex',
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
    
    imgStyle :{
        marginTop:'5%',
        height:150,
        width:150,
        borderRadius:10000000
    },

    button:{
        marginTop:"2%",
        padding:0
    },

    box:{
        width : '90%',
        height:1,
        backgroundColor:'blue',
    },

    text:{
        marginTop:"2%",
        marginLeft:"5%",
        marginBottom:"2%",
        display:"flex",
        alignSelf:'flex-start'
    },

    editButton:{
        display:'flex',
        alignItems:'center',
        justifyContent:'center',
        marginTop:"5%",
        height:"5%",
        width:"20%",
        borderWidth:1,
        borderColor:'black',
        borderRadius:15
    },

    editButtonText:{
        color:'red'
    },

    conteinreModalwindow:{
        display:'flex',
        flex: 1,
        alignItems: 'center',
        justifyContent:'center',
        width:'50%'
    },

    modalWindow:{
        backgroundColor:'white',
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        width:'50%'
    }

});

export default StyleCentre;
